    /* harmony default export */


    __webpack_exports__["default"] = "<div class=\"cookies-main-conatiner\">\n    <div class=\"cookies-heading heading-nestimate\">\n        Cookie Policy\n    </div>\n\n    <div class=\"content-cookies\">\n\n        <p class=\"outputText\">We use cookies and similar technologies on our websites and apps.</p>\n\n        <p class=\"outputText\">A cookie is a piece of information placed on your device to remember something about you\n            or your device. We use cookies to distinguish you from other users and to remember your preferences and to\n            help us make your experience of our websites and apps better. We also use cookies to show you tailored\n            adverts (including on other websites) which are more relevant to your interests.</p>\n\n        <p class=\"outputText\">Without these cookies, you will see advertising, but they may be irrelevant to you. We\n            need to use some Necessary cookies to make our website work, and you cant turn these off here. For\n            others, you can choose which categories we use by adjusting your preferences below.</p>\n\n        <p class=\"outputText\">You can find out more about cookies by visiting <span\n                class=\"heading-nestimate\">www.allaboutcookies.org</span> and <span class=\"heading-nestimate\">\n                www.youronlinechoices.eu.</span></p>\n\n    </div>\n\n    <div class=\"content-cookies-light content-cookies\">\n        <div class=\"heading-nestimate cookies-heading-prenfrence\">Your cookie preferences</div>\n\n        <p class=\"outputText\">We use cookies and similar technologies to improve your Zoopla experience, display\n            advertising more relevant to you and allow you to sign into Zoopla with your social media accounts.</p>\n        <p class=\"outputText\">You can use the settings below to accept all cookies (which we recommend to give you the\n            best personalised online experience) or to enable specific categories of cookies. You can change your\n            settings at any time by returning to this page.</p>\n    </div>\n\n    <div class=\"content-cookies\">\n\n        <div class=\"checkbox-cookies\">\n            <mat-checkbox [(ngModel)]=\"checked\" disabled>Necessary</mat-checkbox>\n            <mat-checkbox>Tailored advertising</mat-checkbox>\n            <mat-checkbox>Personalised experience</mat-checkbox>\n        </div>\n\n        <div class=\"cookies-button\">\n            <div class=\"heading-nestimate button-save\" (click)=\"closeCookie()\" routerLink=\"/\">Save my prefrences</div>\n\n            <div class=\"outputText accept-all\" (click)=\"closeCookie()\" routerLink=\"/\">Accept all cookies</div>\n        </div>\n\n\n    </div>\n\n\n    <mat-expansion-panel (opened)=\"panelOpenState = true\" (closed)=\"panelOpenState = false\">\n        <mat-expansion-panel-header>\n            <mat-panel-title class=\"heading-nestimate panel-font-heading\">\n                Necessary\n            </mat-panel-title>\n            <mat-panel-description class=\"expansion-discription heading-nestimate \">\n                What's this?\n            </mat-panel-description>\n        </mat-expansion-panel-header>\n        <p>We need to use some cookies to make our website work properly and enable you to use all its functions such as\n            the mortgage calculator, and you cannot turn them off on our website but if you disable these cookies in\n            your browser settings, our websites and apps will not work correctly. We also use some cookies that let you\n            use your social media details to log in to your account, and to count visitors to our website and where they\n            most like to go on the site. This helps us to improve its overall functionality and to get paid by\n            advertisers given we provide our services to our visitors without requesting payment from them.</p>\n\n        <mat-card>\n            <div class=\"main-card-more\">\n                <div class=\"heading-left heading-nestimate\">Name:</div>\n                <div class=\"content-right outputText\">&nbsp;abext</div>\n\n            </div>\n            <div class=\"main-card-more\">\n                <div class=\"heading-left heading-nestimate\">Purpose:<span class=\"outputText\">&nbsp;Used by the tech team\n                        to release new website functionalities in a staged approach.</span> </div>\n\n\n            </div>\n            <div class=\"main-card-more\">\n                <div class=\"heading-left heading-nestimate\">Duration:</div>\n                <div class=\"content-right outputText\">&nbsp;3 months</div>\n\n            </div>\n        </mat-card>\n\n        <mat-card class=\"mt-4\">\n            <div class=\"main-card-more\">\n                <div class=\"heading-left heading-nestimate\">Name:</div>\n                <div class=\"content-right outputText\">&nbsp; affordabilityCalculator</div>\n\n            </div>\n            <div class=\"main-card-more\">\n                <div class=\"heading-left heading-nestimate\">Purpose:<span class=\"outputText\">&nbsp;Used to preserve the values you input to the affordability calculator between rental property listings</span> </div>\n\n\n            </div>\n            <div class=\"main-card-more\">\n                <div class=\"heading-left heading-nestimate\">Duration:</div>\n                <div class=\"content-right outputText\">&nbsp;Forever</div>\n\n            </div>\n        </mat-card>\n        \n        <mat-card class=\"mt-4\">\n            <div class=\"main-card-more\">\n                <div class=\"heading-left heading-nestimate\">Name:</div>\n                <div class=\"content-right outputText\">&nbsp; affordabilityCalculator</div>\n\n            </div>\n            <div class=\"main-card-more\">\n                <div class=\"heading-left heading-nestimate\">Purpose:<span class=\"outputText\">&nbsp;Used to preserve the values you input to the affordability calculator between rental property listings</span> </div>\n\n\n            </div>\n            <div class=\"main-card-more\">\n                <div class=\"heading-left heading-nestimate\">Duration:</div>\n                <div class=\"content-right outputText\">&nbsp;1 year</div>\n\n            </div>\n        </mat-card>\n\n    </mat-expansion-panel>\n\n\n\n\n\n    <mat-expansion-panel (opened)=\"panelOpenState = true\" (closed)=\"panelOpenState = false\" class=\"mt-3\">\n        <mat-expansion-panel-header>\n            <mat-panel-title class=\"heading-nestimate panel-font-heading\">\n                Tailored advertising\n            </mat-panel-title>\n            <mat-panel-description class=\"expansion-discription heading-nestimate \">\n                What's this?\n            </mat-panel-description>\n        </mat-expansion-panel-header>\n        <p>Our advertising partners and we use advertising cookies so that we can work out what youre interested in based on how you use our websites and apps and other websites. Accepting these cookies means you might see our adverts on other websites and social media platforms. You will also see other adverts which are more relevant to your interests. If you dont accept these, you will still see untailored online advertising.</p>\n\n        <mat-card>\n            <div class=\"main-card-more\">\n                <div class=\"heading-left heading-nestimate\">Name:</div>\n                <div class=\"content-right outputText\">&nbsp;Google Ads</div>\n\n            </div>\n            <div class=\"main-card-more\">\n                <div class=\"heading-left heading-nestimate\">Purpose:<span class=\"outputText\">&nbsp; Google Ads provides Zoopla with the ability to track pay-per-click advertising conversion.</span> </div>\n\n\n            </div>\n            <div class=\"main-card-more\">\n                <div class=\"heading-left heading-nestimate\" routerLink=\"/PrivacyPolicy\">Privacy Policy</div>\n              \n\n            </div>\n        </mat-card>\n\n        <mat-card class=\"mt-4\">\n            <div class=\"main-card-more\">\n                <div class=\"heading-left heading-nestimate\">Name:</div>\n                <div class=\"content-right outputText\">&nbsp;AddThis</div>\n\n            </div>\n            <div class=\"main-card-more\">\n                <div class=\"heading-left heading-nestimate\">Purpose:<span class=\"outputText\">&nbsp;AddThis provides easy social media bookmarking on our platform.</span> </div>\n\n\n            </div>\n            <div class=\"main-card-more\">\n                <div class=\"heading-left heading-nestimate\" routerLink=\"/PrivacyPolicy\">Privacy Policy</div>\n\n            </div>\n        </mat-card>\n        \n        <mat-card class=\"mt-4\">\n            <div class=\"main-card-more\">\n                <div class=\"heading-left heading-nestimate\">Name:</div>\n                <div class=\"content-right outputText\">&nbsp;Facebook</div>\n\n            </div>\n            <div class=\"main-card-more\">\n                <div class=\"heading-left heading-nestimate\">Purpose:<span class=\"outputText\">&nbsp;Facebook is used as one of our trusted social media integration. Together with Facebook, we gather data on pages viewed and actions completed to make property recommendations via advertisements when browsing Facebook.</span> </div>\n\n\n            </div>\n            <div class=\"main-card-more\">\n                <div class=\"heading-left heading-nestimate\" routerLink=\"/PrivacyPolicy\">Privacy Policy</div>\n\n            </div>\n        </mat-card>\n\n    </mat-expansion-panel>\n\n\n    <mat-card class=\"mt-3\">\n  <div class=\"heading-nestimate font-heading\">Personalised experience</div>\n  <div class=\"outputText\">We use functional cookies to improve and personalise your experience on our websites and apps. We think these enhance your experience of using our services.</div>\n    </mat-card>\n\n\n\n    <mat-card class=\"mt-3\">\n        <div class=\"heading-nestimate font-heading\">Refusing or withdrawing your consent to the use of cookies</div>\n        <div class=\"outputText mt-2\">You don't have to give consent to all our cookies. You can refuse consent by selecting only the categories of cookies you want us to use on this page, by adjusting your browser settings, or by using our website in \"incognito\" or \"private\" mode.</div>\n        <div class=\"outputText mt-2\">If you adjust your browser settings or use our website in \"incognito\" or \"private\" mode, you'll also refuse essential cookies and so some parts of our website or apps might not work as well as they otherwise would.</div>\n          </mat-card>\n\n\n          <mat-card class=\"mt-3 mb-3\">\n            <div class=\"heading-nestimate font-heading\">Updates to this policy</div>\n            <div class=\"outputText mt-2\">We change the cookies we use from time to time as we try to make our websites and apps even better. We'll do our best to update this page when we make changes, so make sure you check back regularly.</div>\n\n              </mat-card>\n\n</div>";
